    150_de:
        Id: 150
        Locale: de
        Country: France
        OuvertureReception: 8h-11h/15h-20h
        OuvertureCamping: 12/04/2013-29/09/2013
        ArriveesDeparts: null
        Description: 'Im Herzen der Camargue gelegen und nicht weit vom größten Strand Europas, dem "Plage Espiguette", entfernt, lädt Sie der Campingplatz "La Marine" zu einem erholsamen und erlebnisreichen Urlaub ein. Es erwarten Sie verschiedenste Mobilhomes, umrahmt von einem herrlichen Pinienwald und viele Ausflugsmöglichkeiten in eine faszinierende Umgebung, wie beispielsweise ein Ausritt in die schöne Camargue.'
    150_en:
        Id: 150
        Locale: en
        Country: France
        OuvertureReception: 8h-11h/15h-20h
        OuvertureCamping: 12/04/2013-29/09/2013
        ArriveesDeparts: null
        Description: null
    150_fr:
        Id: 150
        Locale: fr
        Country: France
        OuvertureReception: 8h-11h/15h-20h
        OuvertureCamping: 12/04/2013-29/09/2013
        ArriveesDeparts: 'Du 12/04/2013 au 06/07/2013 et du 31/08/2013 au 29/09/2013, tous les jours sauf le mardi. Du 06/07/2013 au 31/08/2012, le mercredi et le samedi.'
        Description: 'Au coeur de la Camargue, au grau-du-Roi, et situé sur la route de la plage de l''Espiguette, la plus grande plage d''Europe (navette), le camping la Marine vous invite à la détente autour de son espace piscine. Activités sportives, aquatiques, découverte de la Camargue et détente-relaxation seront au rendez-vous.'
    150_nl:
        Id: 150
        Locale: nl
        Country: null
        OuvertureReception: 8h-11h/15h-20h
        OuvertureCamping: 12/04/2013-29/09/2013
        ArriveesDeparts: null
        Description: "Midden in de Camargue en langs de weg naar het strand van de Espiguette, het grootste strand van Europa (pendeldienst), biedt het vakantiepark annex camping la Marine u ontspanning rond het zwembad. U vindt mogelijkheden voor sport en watersport, u kunt de Camargue gaan verkennen en nu echt ontspannen. Verken de Camargue te paard, of maak 's ochtend in alle vroegte een wandeling, tenzij u natuurlijk liever wat gaat varen...in elk geval, volg de ingeving van uw hart en geniet ten volle van deze heel bijzondere streek.\r\nU dient uw eigen bedlinnen & handdoeken mee te nemen, eventueel kunt u bedlinnen ook ter plaatse huren of kopen."
